import java.io.Serializable;
import java.util.Objects;

public class BankDataId implements Serializable {

    private String mandt;
    private String lifnr;

    public String getMandt() {
        return this.mandt;
    }

    public void setMandt(String mandt) {
        this.mandt = mandt;
    }

    public String getLifnr() {
        return this.lifnr;
    }

    public void setLifnr(String lifnr) {
        this.lifnr = lifnr;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (!(o instanceof BankData)) return false;
        final BankData bankData = (BankData) o;
        return Objects.equals(getMandt(), bankData.getMandt()) &&
                Objects.equals(getLifnr(), bankData.getLifnr());
    }

    @Override
    public int hashCode() {
        return Objects.hash(getMandt(),
                getLifnr());
    }
}